class Solution {
    /**
    Return list of all prefixes from shortest to longest of the input string
    >>> all_prefixes("abc")
    ["a", "ab", "abc"]
     */
    public List<String> all_prefixes(String string) {
        // Initialize an empty list to store the prefixes
        List<String> prefixes = new ArrayList<>();

        // Iterate through the string to generate all prefixes
        for (int i = 1; i <= string.length(); i++) {
            // Extract the prefix from the start of the string to the current index
            String prefix = string.substring(0, i);
            // Add the prefix to the list
            prefixes.add(prefix);
        }

        // Return the list of prefixes
        return prefixes;
    }

    // Main method for testing
    public static void main(String[] args) {
        Solution solution = new Solution();
        List<String> result = solution.all_prefixes("abc");
        System.out.println(result); // Expected output: [a, ab, abc]
    }
}

