class Solution {
    /**
    Given a positive floating point number, it can be decomposed into
    and integer part (largest integer smaller than given number) and decimals
    (leftover part always smaller than 1).

    Return the decimal part of the number.
    >>> truncate_number(3.5)
    0.5
     */
    public double truncate_number(double number) {
        // Step 1: Extract the integer part of the number
        int integerPart = (int) number;

        // Step 2: Subtract the integer part from the original number to get the decimal part
        double decimalPart = number - integerPart;

        // Step 3: Return the decimal part
        return decimalPart;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.truncate_number(3.5)); // Expected output: 0.5
        System.out.println(solution.truncate_number(7.25)); // Expected output: 0.25
        System.out.println(solution.truncate_number(10.99)); // Expected output: 0.99
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
            s.truncate_number(3.5) == 0.5,
            Math.abs(s.truncate_number(1.33) - 0.33) < 1e-6,
            Math.abs(s.truncate_number(123.456) - 0.456) < 1e-6
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

