class Solution {
    /**
    Return a greatest common divisor of two integers a and b
    >>> greatest_common_divisor(3, 5)
    1
    >>> greatest_common_divisor(25, 15)
    5
     */
    public int greatest_common_divisor(int a, int b) {
        // Ensure a is always greater than or equal to b
        if (a < b) {
            int temp = a;
            a = b;
            b = temp;
        }

        // Use the Euclidean algorithm to find the GCD
        while (b != 0) {
            int remainder = a % b;
            a = b;
            b = remainder;
        }

        return a;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.greatest_common_divisor(3, 5)); // Output: 1
        System.out.println(solution.greatest_common_divisor(25, 15)); // Output: 5
    }
}

