class Solution {
    public List<String> separate_paren_groups(String paren_string) {
        // Remove spaces from the input string
        String cleanedString = paren_string.replaceAll("\\s+", "");

        // Initialize a list to store the separated groups
        List<String> groups = new ArrayList<>();

        // Initialize variables to track the balance of parentheses and the current group
        int balance = 0;
        StringBuilder currentGroup = new StringBuilder();

        // Iterate through each character in the cleaned string
        for (char c : cleanedString.toCharArray()) {
            // Append the character to the current group
            currentGroup.append(c);

            // Update the balance based on the character
            if (c == '(') {
                balance++;
            } else if (c == ')') {
                balance--;
            }

            // If the balance is zero, we have a complete group
            if (balance == 0) {
                groups.add(currentGroup.toString());
                currentGroup = new StringBuilder(); // Reset the current group
            }
        }

        return groups;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.separate_paren_groups("(()()) ((())) () ((())()())").equals(Arrays.asList(
                        "(()())", "((()))", "()", "((())()())"
                )),
                s.separate_paren_groups("() (()) ((())) (((())))").equals(Arrays.asList(
                        "()", "(())", "((()))", "(((())))"
                )),
                s.separate_paren_groups("(()(())((())))").equals(Arrays.asList(
                        "(()(())((())))"
                )),
                s.separate_paren_groups("( ) (( )) (( )( ))").equals(Arrays.asList("()", "(())", "(()())"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

