class Solution {
    /**
    You're given a list of deposit and withdrawal operations on a bank account that starts with
    zero balance. Your task is to detect if at any point the balance of account falls below zero, and
    at that point function should return True. Otherwise it should return False.
    >>> below_zero(Arrays.asList(1, 2, 3))
    false
    >>> below_zero(Arrays.asList(1, 2, -4, 5))
    true
     */
    public boolean below_zero(List<Integer> operations) {
        // Initialize the balance to zero
        int balance = 0;

        // Iterate through each operation in the list
        for (int operation : operations) {
            // Update the balance based on the current operation
            balance += operation;

            // Check if the balance falls below zero
            if (balance < 0) {
                return true;
            }
        }

        // If the loop completes without the balance falling below zero, return false
        return false;
    }
}

