class Solution {
    public List<Integer> rolling_max(List<Integer> numbers) {
        List<Integer> result = new ArrayList<>();
        if (numbers == null || numbers.isEmpty()) {
            return result;
        }

        int current_max = numbers.get(0);
        for (int num : numbers) {
            if (num > current_max) {
                current_max = num;
            }
            result.add(current_max);
        }

