class Solution {
    /**
    Find how many times a given substring can be found in the original string. Count overlapping cases.
    */
    public int how_many_times(String string, String substring) {
        // If the substring is empty or longer than the string, return 0
        if (substring.isEmpty() || substring.length() > string.length()) {
            return 0;
        }

        int count = 0;
        int index = 0;

        // Loop through the string to find all occurrences of the substring
        while (index != -1) {
            // Find the next occurrence of the substring starting from the current index
            index = string.indexOf(substring, index);

            // If a match is found, increment the count and move the index forward by 1
            if (index != -1) {
                count++;
                index++;
            }
        }

        return count;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.how_many_times("", "a")); // Output: 0
        System.out.println(solution.how_many_times("aaa", "a")); // Output: 3
        System.out.println(solution.how_many_times("aaaa", "aa")); // Output: 3
    }
}

