class Solution {
    public List<Double> find_closest_elements(List<Double> numbers) {
        // Step 1: Sort the list of numbers
        Collections.sort(numbers);

        // Step 2: Initialize variables
        double min_diff = Double.MAX_VALUE;
        List<Double> closest_pair = new ArrayList<>();

        // Step 3: Iterate through the sorted list
        for (int i = 0; i < numbers.size() - 1; i++) {
            double diff = Math.abs(numbers.get(i) - numbers.get(i + 1));
            if (diff < min_diff) {
                min_diff = diff;
                closest_pair.clear();
                closest_pair.add(numbers.get(i));
                closest_pair.add(numbers.get(i + 1));
            }
        }

        // Step 4: Return the closest pair
        return closest_pair;
    }
}

