class Solution {
    public String sort_numbers(String numbers) {
        // Step 1: Create a mapping from words to their corresponding numeric values
        Map<String, Integer> numberMap = new HashMap<>();
        numberMap.put("zero", 0);
        numberMap.put("one", 1);
        numberMap.put("two", 2);
        numberMap.put("three", 3);
        numberMap.put("four", 4);
        numberMap.put("five", 5);
        numberMap.put("six", 6);
        numberMap.put("seven", 7);
        numberMap.put("eight", 8);
        numberMap.put("nine", 9);

        // Step 2: Split the input string into an array of words
        String[] numberWords = numbers.split(" ");

        // Step 3: Convert the words to their numeric values using the map
        List<Integer> numberValues = new ArrayList<>();
        for (String word : numberWords) {
            numberValues.add(numberMap.get(word));
        }

        // Step 4: Sort the numeric values
        Collections.sort(numberValues);

        // Step 5: Convert the sorted numeric values back to words
        StringBuilder result = new StringBuilder();
        for (int value : numberValues) {
            for (Map.Entry<String, Integer> entry : numberMap.entrySet()) {
                if (entry.getValue().equals(value)) {
                    result.append(entry.getKey()).append(" ");
                    break;
                }
            }
        }

        // Step 6: Remove the trailing space and return the result
        return result.toString().trim();
    }
}

