class Solution {
    /**
    For a given string, flip lowercase characters to uppercase and uppercase to lowercase.
    >>> flip_case("Hello")
    "hELLO"
     */
    public String flip_case(String string) {
        // Step 1: Convert the input string to a character array
        char[] chars = string.toCharArray();

        // Step 2: Iterate through each character in the array
        for (int i = 0; i < chars.length; i++) {
            // Step 3: Check if the character is lowercase
            if (Character.isLowerCase(chars[i])) {
                // Step 4: Convert it to uppercase
                chars[i] = Character.toUpperCase(chars[i]);
            } else if (Character.isUpperCase(chars[i])) {
                // Step 5: If the character is uppercase, convert it to lowercase
                chars[i] = Character.toLowerCase(chars[i]);
            }
        }

        // Step 6: Convert the character array back to a string and return it
        return new String(chars);
    }
}

