class Solution {
    /**
    Input to this function is a string representing musical notes in a special ASCII format.
    Your task is to parse this string and return list of integers corresponding to how many beats does each
    not last.

    Here is a legend:
    "o" - whole note, lasts four beats
    "o|" - half note, lasts two beats
    ".|" - quater note, lasts one beat

    >>> parse_music("o o| .| o| o| .| .| .| .| o o")
    [4, 2, 1, 2, 2, 1, 1, 1, 1, 4, 4]
     */
    public List<Integer> parse_music(String string) {
        // Split the input string by spaces to get individual notes
        String[] notes = string.split(" ");

        // Initialize a list to store the beats for each note
        List<Integer> beats = new ArrayList<>();

        // Iterate through each note and determine its corresponding beats
        for (String note : notes) {
            switch (note) {
                case "o":
                    beats.add(4); // Whole note lasts 4 beats
                    break;
                case "o|":
                    beats.add(2); // Half note lasts 2 beats
                    break;
                case ".|":
                    beats.add(1); // Quarter note lasts 1 beat
                    break;
                default:
                    throw new IllegalArgumentException("Invalid note: " + note);
            }
        }

        // Return the list of beats
        return beats;
    }
}

