class Solution {
    /**
    Return true if a given number is prime, and false otherwise.
    */
    public boolean is_prime(int n) {
        // Step 1: Handle edge cases
        if (n <= 1) {
            return false;
        }
        if (n == 2 || n == 3) {
            return true;
        }
        if (n % 2 == 0 || n % 3 == 0) {
            return false;
        }

        // Step 2: Check divisibility from 5 to sqrt(n)
        for (int i = 5; i * i <= n; i += 6) {
            if (n % i == 0 || n % (i + 2) == 0) {
                return false;
            }
        }

        // Step 3: If no divisors found, the number is prime
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.is_prime(6));    // false
        System.out.println(solution.is_prime(101));  // true
        System.out.println(solution.is_prime(11));   // true
        System.out.println(solution.is_prime(13441)); // true
        System.out.println(solution.is_prime(61));   // true
        System.out.println(solution.is_prime(4));    // false
        System.out.println(solution.is_prime(1));    // false
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.is_prime(6),
                s.is_prime(101),
                s.is_prime(11),
                s.is_prime(13441),
                s.is_prime(61),
                !s.is_prime(4),
                !s.is_prime(1),
                s.is_prime(5),
                s.is_prime(11),
                s.is_prime(17),
                !s.is_prime(5 * 17),
                !s.is_prime(11 * 7),
                !s.is_prime(13441 * 19)
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

