class Solution {
    /**
    Return maximum element in the list.
    >>> max_element(Arrays.asList(1, 2, 3))
    3
    >>> max_element(Arrays.asList(5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10))
    123
     */
    public int max_element(List<Integer> l) {
        // Check if the list is empty
        if (l.isEmpty()) {
            throw new IllegalArgumentException("List is empty");
        }

        // Initialize the maximum element with the first element of the list
        int max = l.get(0);

        // Iterate through the list to find the maximum element
        for (int num : l) {
            if (num > max) {
                max = num;
            }
        }

        // Return the maximum element
        return max;
    }
}

