class Solution {
    /**
    Evaluates polynomial with coefficients xs at point x.
    return xs[0] + xs[1] * x + xs[1] * x^2 + .... xs[n] * x^n
     */
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    /**
    Computes the derivative of the polynomial with coefficients xs.
     */
    public List<Double> derivative(List<Double> xs) {
        List<Double> derivativeCoeffs = new ArrayList<>();
        for (int i = 1; i < xs.size(); i++) {
            derivativeCoeffs.add(xs.get(i) * i);
        }
        return derivativeCoeffs;
    }

    /**
    Finds a zero of the polynomial with coefficients xs using the Newton-Raphson method.
     */
    public double find_zero(List<Double> xs) {
        List<Double> derivativeCoeffs = derivative(xs);
        double x = 0;  // Initial guess
        double tolerance = 1e-7;  // Convergence criterion
        int maxIterations = 1000;  // Maximum number of iterations

        for (int i = 0; i < maxIterations; i++) {
            double fx = poly(xs, x);
            double dfx = poly(derivativeCoeffs, x);

            if (Math.abs(dfx) < tolerance) {
                break;  // Avoid division by zero
            }

            double xNew = x - fx / dfx;

            if (Math.abs(xNew - x) < tolerance) {
                return xNew;
            }

            x = xNew;
        }

        return x;  // Return the best estimate
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        List<Double> xs1 = Arrays.asList(1.0, 2.0);
        System.out.println(sol.find_zero(xs1));  // Output: -0.5

        List<Double> xs2 = Arrays.asList(-6.0, 11.0, -6.0, 1.0);
        System.out.println(sol.find_zero(xs2));  // Output: 1.0
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        Random rand = new Random(42);
        for (int i = 0; i < 100; i++) {
            int ncoeff = 2 * (rand.nextInt(3) + 1);
            List<Double> coeffs = new ArrayList<>();
            for (int j = 0; j < ncoeff; j++) {
                int coeff = rand.nextInt(20) - 10;
                if (coeff == 0) {
                    coeff = 1;
                }
                coeffs.add((double) coeff);
            }
            double solution = s.find_zero(coeffs);
            if (Math.abs(s.poly(coeffs, solution)) > 1e-4) {
                throw new AssertionError();
            }
        }
    }
}

