class Solution {
    public List<Integer> sort_third(List<Integer> l) {
        // Step 1: Identify indices divisible by 3
        List<Integer> indices_divisible_by_3 = new ArrayList<>();
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                indices_divisible_by_3.add(i);
            }
        }

        // Step 2: Extract elements at these indices
        List<Integer> elements_to_sort = new ArrayList<>();
        for (int index : indices_divisible_by_3) {
            elements_to_sort.add(l.get(index));
        }

        // Step 3: Sort the extracted elements
        Collections.sort(elements_to_sort);

        // Step 4: Replace elements at the identified indices with the sorted elements
        for (int i = 0; i < indices_divisible_by_3.size(); i++) {
            l.set(indices_divisible_by_3.get(i), elements_to_sort.get(i));
        }

        // Step 5: Return the modified list
        return l;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.sort_third(Arrays.asList(1, 2, 3))); // [1, 2, 3]
        System.out.println(solution.sort_third(Arrays.asList(5, 6, 3, 4, 8, 9, 2))); // [2, 6, 3, 4, 8, 9, 5]
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.sort_third(new ArrayList<>(Arrays.asList(5, 6, 3, 4, 8, 9, 2))).equals(Arrays.asList(2, 6, 3, 4, 8, 9, 5)),
