class Solution {
    /**
    This function takes a list l and returns a list l' such that
    l' is identical to l in the odd indicies, while its values at the even indicies are equal
    to the values of the even indicies of l, but sorted.
    >>> sort_even(Arrays.asList(1, 2, 3))
    [1, 2, 3]
    >>> sort_even(Arrays.asList(5, 6, 3, 4))
    [3, 6, 5, 4]
     */
    public List<Integer> sort_even(List<Integer> l) {
        // Extract even indices values
        List<Integer> evenIndicesValues = new ArrayList<>();
        for (int i = 0; i < l.size(); i += 2) {
            evenIndicesValues.add(l.get(i));
        }

        // Sort the even indices values
        Collections.sort(evenIndicesValues);

        // Create the result list
        List<Integer> result = new ArrayList<>(l.size());
        int evenIndex = 0;

        for (int i = 0; i < l.size(); i++) {
            if (i % 2 == 0) {
                // Even index, use sorted value
                result.add(evenIndicesValues.get(evenIndex++));
            } else {
                // Odd index, use original value
                result.add(l.get(i));
            }
        }

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.sort_even(new ArrayList<>(Arrays.asList(1, 2, 3))).equals(Arrays.asList(1, 2, 3)),
                s.sort_even(new ArrayList<>(Arrays.asList(5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10))).equals(Arrays.asList(-10, 3, -5, 2, -3, 3, 5, 0, 9, 1, 123)),
                s.sort_even(new ArrayList<>(Arrays.asList(5, 8, -12, 4, 23, 2, 3, 11, 12, -10))).equals(Arrays.asList(-12, 8, 3, 4, 5, 2, 12, 11, 23, -10))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

