class Solution {
    public boolean triples_sum_to_zero(List<Integer> l) {
        // If the list has less than 3 elements, return false
        if (l.size() < 3) {
            return false;
        }

        // Sort the list to make it easier to find triplets
        Collections.sort(l);

        // Iterate through the list and use two pointers to find triplets
        for (int i = 0; i < l.size() - 2; i++) {
            int left = i + 1;
            int right = l.size() - 1;

            while (left < right) {
                int sum = l.get(i) + l.get(left) + l.get(right);

                if (sum == 0) {
                    return true;
                } else if (sum < 0) {
                    left++;
                } else {
                    right--;
                }
            }
        }

        // If no triplet sums to zero, return false
        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, 5, 0))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, 5, -1))),
                s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, -2, 1))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 2, 3, 7))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 2, 5, 7))),
                s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(2, 4, -5, 3, 9, 7))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, 5, -100))),
                !s.triples_sum_to_zero(new ArrayList<>(Arrays.asList(100, 3, 5, -100)))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

