class Solution {
    public boolean pairs_sum_to_zero(List<Integer> l) {
        Set<Integer> seen = new HashSet<>();

        for (int num : l) {
            if (seen.contains(-num)) {
                return true;
            }
            seen.add(num);
        }

        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.pairs_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, 5, 0))),
                !s.pairs_sum_to_zero(new ArrayList<>(Arrays.asList(1, 3, -2, 1))),
                !s.pairs_sum_to_zero(new ArrayList<>(Arrays.asList(1, 2, 3, 7))),
