class Solution {
    /**
    Return 2^n modulo p (be aware of numerics).
    >>> modp(3, 5)
    3
    >>> modp(1101, 101)
    2
    >>> modp(0, 101)
    1
    >>> modp(3, 11)
    8
    >>> modp(100, 101)
    1
     */
    public int modp(int n, int p) {
        int result = 1;
        int base = 2;

        while (n > 0) {
            if (n % 2 == 1) {
                result = (result * base) % p;
            }
            base = (base * base) % p;
            n = n / 2;
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.modp(3, 5));    // Output: 3
        System.out.println(solution.modp(1101, 101)); // Output: 2
        System.out.println(solution.modp(0, 101));  // Output: 1
        System.out.println(solution.modp(3, 11));   // Output: 8
        System.out.println(solution.modp(100, 101)); // Output: 1
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.modp(3, 5) == 3,
                s.modp(1101, 101) == 2,
                s.modp(0, 101) == 1,
                s.modp(3, 11) == 8,
                s.modp(100, 101) == 1,
                s.modp(30, 5) == 4,
                s.modp(31, 5) == 3
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

