class Solution {
    public int fib4(int n) {
        // Base cases
        if (n == 0 || n == 1 || n == 3) {
            return 0;
        }
        if (n == 2) {
            return 2;
        }

        // Initialize the first four elements of the sequence
        int[] fib4Sequence = new int[n + 1];
        fib4Sequence[0] = 0;
        fib4Sequence[1] = 0;
        fib4Sequence[2] = 2;
        fib4Sequence[3] = 0;

        // Compute the sequence iteratively
        for (int i = 4; i <= n; i++) {
            fib4Sequence[i] = fib4Sequence[i - 1] + fib4Sequence[i - 2] + fib4Sequence[i - 3] + fib4Sequence[i - 4];
        }

        return fib4Sequence[n];
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.fib4(5)); // Output: 4
        System.out.println(solution.fib4(6)); // Output: 8
        System.out.println(solution.fib4(7)); // Output: 14
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.fib4(5) == 4,
                s.fib4(8) == 28,
                s.fib4(10) == 104,
                s.fib4(12) == 386
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

