class Solution {
    /**
    Change numerical base of input number x to base.
    return string representation after the conversion.
    base numbers are less than 10.
    >>> change_base(8, 3)
    "22"
    >>> change_base(8, 2)
    "1000"
    >>> change_base(7, 2)
    "111"
     */
    public String change_base(int x, int base) {
        // Step 1: Initialize a StringBuilder to store the result
        StringBuilder result = new StringBuilder();

        // Step 2: Handle the case where x is 0
        if (x == 0) {
            return "0";
        }

        // Step 3: Convert the number to the new base
        while (x > 0) {
            int remainder = x % base;
            result.append(remainder);
            x /= base;
        }

        // Step 4: Reverse the result to get the correct order
        return result.reverse().toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.change_base(8, 3)); // Output: "22"
        System.out.println(solution.change_base(8, 2)); // Output: "1000"
        System.out.println(solution.change_base(7, 2)); // Output: "111"
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.change_base(8, 3), "22"),
                Objects.equals(s.change_base(9, 3), "100"),
                Objects.equals(s.change_base(234, 2), "11101010"),
                Objects.equals(s.change_base(16, 2), "10000"),
                Objects.equals(s.change_base(8, 2), "1000"),
                Objects.equals(s.change_base(7, 2), "111")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
        for (int x = 2; x < 8; x++) {
            if (!Objects.equals(s.change_base(x, x + 1), String.valueOf(x))) {
                throw new AssertionError();
            }
        }
    }
}

