class Solution {
    /**
    Return True if all numbers in the list l are below threshold t.
    >>> below_threshold(Arrays.asList(1, 2, 4, 10), 100)
    true
    >>> below_threshold(Arrays.asList(1, 20, 4, 10), 5)
    false
     */
    public boolean below_threshold(List<Integer> l, int t) {
        // Iterate through the list and check if any number is greater than or equal to the threshold
        for (int num : l) {
            if (num >= t) {
                return false; // If any number is greater than or equal to the threshold, return false
            }
        }
        return true; // If no number is greater than or equal to the threshold, return true
    }
}

