class Solution {
    public double median(List<Integer> l) {
        // Step 1: Sort the list
        Collections.sort(l);

        // Step 2: Determine the size of the list
        int n = l.size();

        // Step 3: Calculate the median
        if (n % 2 == 1) {
            // If the list size is odd, return the middle element
            return l.get(n / 2);
        } else {
            // If the list size is even, return the average of the two middle elements
            return (l.get(n / 2 - 1) + l.get(n / 2)) / 2.0;
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.median(new ArrayList<>(Arrays.asList(3, 1, 2, 4, 5))) == 3,
                s.median(new ArrayList<>(Arrays.asList(-10, 4, 6, 1000, 10, 20))) == 8.0,
                s.median(new ArrayList<>(Arrays.asList(5))) == 5,
                s.median(new ArrayList<>(Arrays.asList(6, 5))) == 5.5
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

