class Solution {
    public boolean same_chars(String s0, String s1) {
        // Create sets to store unique characters from both strings
        Set<Character> set0 = new HashSet<>();
        Set<Character> set1 = new HashSet<>();

        // Add characters from the first string to set0
        for (char c : s0.toCharArray()) {
            set0.add(c);
        }

        // Add characters from the second string to set1
        for (char c : s1.toCharArray()) {
            set1.add(c);
        }

        // Check if the sets are equal
        return set0.equals(set1);
    }

