class Solution {
    /**
    Checks if given string is a palindrome
    >>> is_palindrome("")
    true
    >>> is_palindrome("aba")
    true
    >>> is_palindrome("aaaaa")
    true
    >>> is_palindrome("zbcd")
    false
     */
    public boolean is_palindrome(String text) {
        // Step 1: Understand the problem
        // A palindrome is a string that reads the same backward as forward.

        // Step 2: Algorithm/Method Selection
        // We can check if a string is a palindrome by comparing characters from the start and end moving towards the center.

        // Step 3: Pseudocode Creation
        // 1. Initialize two pointers, one at the start and one at the end of the string.
        // 2. While the start pointer is less than the end pointer:
        //    a. If the characters at the start and end pointers are not equal, return false.
        //    b. Move the start pointer one step forward.
        //    c. Move the end pointer one step backward.
        // 3. If the loop completes without returning false, return true.

        // Step 4: Code Generation
        int start = 0;
        int end = text.length() - 1;

        while (start < end) {
            if (text.charAt(start) != text.charAt(end)) {
                return false;
            }
            start++;
            end--;
        }

        return true;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.is_palindrome(""),
                s.is_palindrome("aba"),
                s.is_palindrome("aaaaa"),
                !s.is_palindrome("zbcd"),
                s.is_palindrome("xywyx"),
                !s.is_palindrome("xywyz"),
                !s.is_palindrome("xywzx")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

