class Solution {
    /**
    Return n-th Fibonacci number.
    >>> fib(10)
    55
    >>> fib(1)
    1
    >>> fib(8)
    21
     */
    public int fib(int n) {
        // Base cases
        if (n == 0) return 0;
        if (n == 1) return 1;

        // Initialize the first two Fibonacci numbers
        int a = 0, b = 1;

        // Compute the n-th Fibonacci number iteratively
        for (int i = 2; i <= n; i++) {
            int temp = a + b;
            a = b;
            b = temp;
        }

        return b;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.fib(10)); // Output: 55
        System.out.println(solution.fib(1));  // Output: 1
        System.out.println(solution.fib(8));  // Output: 21
    }
}

