class Solution {
    /**
    Return the largest prime factor of n. Assume n > 1 and is not a prime.
    >>> largest_prime_factor(13195)
    29
    >>> largest_prime_factor(2048)
    2
     */
    public int largest_prime_factor(int n) {
        // Step 1: Initialize the largest prime factor variable
        int largestPrimeFactor = -1;

        // Step 2: Divide n by 2 to remove all even factors
        while (n % 2 == 0) {
            largestPrimeFactor = 2;
            n /= 2;
        }

        // Step 3: Check for odd factors from 3 onwards
        for (int i = 3; i <= Math.sqrt(n); i += 2) {
            while (n % i == 0) {
                largestPrimeFactor = i;
                n /= i;
            }
        }

        // Step 4: If n is still greater than 2, then n must be a prime number
        if (n > 2) {
            largestPrimeFactor = n;
        }

        return largestPrimeFactor;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.largest_prime_factor(15) == 5,
                s.largest_prime_factor(27) == 3,
                s.largest_prime_factor(63) == 7,
                s.largest_prime_factor(330) == 11,
                s.largest_prime_factor(13195) == 29
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

