class Solution {
    public boolean correct_bracketing(String brackets) {
        // Initialize a counter for tracking the balance of brackets
        int balance = 0;

        // Iterate through each character in the string
        for (char c : brackets.toCharArray()) {
            // If the character is an opening bracket, increment the balance
            if (c == '(') {
                balance++;
            } 
            // If the character is a closing bracket, decrement the balance
            else if (c == ')') {
                balance--;
            }

            // If at any point the balance is negative, it means there are more closing brackets than opening ones
            if (balance < 0) {
                return false;
            }
        }

        // After processing all characters, the balance should be zero for the string to be correctly bracketed
        return balance == 0;
    }
}

