class Solution {
    public boolean monotonic(List<Integer> l) {
        // Check if the list is empty or has only one element
        if (l == null || l.size() <= 1) {
            return true;
        }

        // Determine if the list is increasing or decreasing
        boolean increasing = l.get(1) > l.get(0);
        boolean decreasing = l.get(1) < l.get(0);

        // If the first two elements are equal, we need to find the next pair that is not equal
        if (l.get(1).equals(l.get(0))) {
            for (int i = 2; i < l.size(); i++) {
                if (!l.get(i).equals(l.get(i - 1))) {
                    increasing = l.get(i) > l.get(i - 1);
                    decreasing = l.get(i) < l.get(i - 1);
                    break;
                }
            }
        }

        // Check the rest of the list based on the determined direction
        for (int i = 1; i < l.size(); i++) {
            if (increasing && l.get(i) < l.get(i - 1)) {
                return false;
            }
            if (decreasing && l.get(i) > l.get(i - 1)) {
                return false;
            }
        }

        return true;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.monotonic(new ArrayList<>(Arrays.asList(1, 2, 4, 10))),
                s.monotonic(new ArrayList<>(Arrays.asList(1, 2, 4, 20))),
                !s.monotonic(new ArrayList<>(Arrays.asList(1, 20, 4, 10))),
                s.monotonic(new ArrayList<>(Arrays.asList(4, 1, 0, -10))),
                s.monotonic(new ArrayList<>(Arrays.asList(4, 1, 1, 0))),
                !s.monotonic(new ArrayList<>(Arrays.asList(1, 2, 3, 2, 5, 60))),
                s.monotonic(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5, 60))),
                s.monotonic(new ArrayList<>(Arrays.asList(9, 9, 9, 9)))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

