class Solution {
    /**
    xs represent coefficients of a polynomial.
    xs[0] + xs[1] * x + xs[2] * x^2 + ....
     Return derivative of this polynomial in the same form.
    >>> derivative(Arrays.asList(3, 1, 2, 4, 5))
    [1, 4, 12, 20]
    >>> derivative(Arrays.asList(1, 2, 3))
    [2, 6]
     */
    public List<Integer> derivative(List<Integer> xs) {
        // Step 1: Initialize an empty list to store the coefficients of the derivative polynomial.
        List<Integer> derivativeCoefficients = new ArrayList<>();

        // Step 2: Iterate through the coefficients starting from the first non-constant term.
        for (int i = 1; i < xs.size(); i++) {
            // Step 3: Calculate the coefficient of the derivative term.
            int coefficient = xs.get(i) * i;

            // Step 4: Add the calculated coefficient to the derivative coefficients list.
            derivativeCoefficients.add(coefficient);
        }

        // Step 5: Return the list of derivative coefficients.
        return derivativeCoefficients;
    }
}

