class Solution {
    public int search(List<Integer> lst) {
        // Step 1: Create a frequency map to store the frequency of each integer
        Map<Integer, Integer> frequencyMap = new HashMap<>();
        for (int num : lst) {
            frequencyMap.put(num, frequencyMap.getOrDefault(num, 0) + 1);
        }

        // Step 2: Iterate through the frequency map to find the greatest integer
        // whose frequency is greater than or equal to its value
        int result = -1;
        for (Map.Entry<Integer, Integer> entry : frequencyMap.entrySet()) {
            int num = entry.getKey();
            int freq = entry.getValue();
            if (freq >= num && num > result) {
                result = num;
            }
        }

        // Step 3: Return the result
        return result;
    }

    // Test cases to verify the solution
