            // Check if the current value is even and smaller than the current smallest even value
            if (value % 2 == 0 && value < smallestEvenValue) {
                smallestEvenValue = value;
                smallestIndex = i;
            }
        }

        // Create the result list
        List<Integer> result = new ArrayList<>();
        // If an even value was found, add it and its index to the result list
        if (smallestIndex != -1) {
            result.add(smallestEvenValue);
            result.add(smallestIndex);
        }

        return result;
    }
}

