class Solution {
    public List<Integer> strange_sort_list(List<Integer> lst) {
        // Create a copy of the original list to avoid modifying it
        List<Integer> sortedList = new ArrayList<>(lst);
        // Sort the list in ascending order
        Collections.sort(sortedList);

        // Initialize the result list
        List<Integer> result = new ArrayList<>();

        // While there are elements in the sorted list
        while (!sortedList.isEmpty()) {
            // Add the smallest element
            result.add(sortedList.remove(0));

            // If the list is not empty, add the largest element
            if (!sortedList.isEmpty()) {
                result.add(sortedList.remove(sortedList.size() - 1));
            }
        }

        return result;
    }
}

