class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if the list is a palindrome
        boolean isBalanced = isPalindrome(q);

        // Calculate the sum of the elements in the list
        int sum = q.stream().mapToInt(Integer::intValue).sum();

        // Check if the list is balanced and the sum is less than or equal to the maximum weight
        return isBalanced && sum <= w;
    }

    // Helper method to check if a list is a palindrome
    private boolean isPalindrome(List<Integer> list) {
        int left = 0;
        int right = list.size() - 1;

        while (left < right) {
            if (!list.get(left).equals(list.get(right))) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }
}

