class Solution {
    /**
    Given an array arr of integers, find the minimum number of elements that
    need to be changed to make the array palindromic. A palindromic array is an array that
    is read the same backwards and forwards. In one change, you can change one element to any other element.
    */

    public int smallest_change(List<Integer> arr) {
        // Step 1: Initialize the count of changes needed
        int changes = 0;

        // Step 2: Use two pointers to compare elements from the start and end of the array
        int left = 0;
        int right = arr.size() - 1;

        // Step 3: Iterate until the pointers meet in the middle
        while (left < right) {
            // Step 4: If the elements at the pointers are not equal, increment the change count
            if (!arr.get(left).equals(arr.get(right))) {
                changes++;
            }

            // Step 5: Move the pointers towards the center
            left++;
            right--;
        }

        // Step 6: Return the total number of changes needed
        return changes;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.smallest_change(Arrays.asList(1, 2, 3, 5, 4, 7, 9, 6))); // Output: 4
        System.out.println(solution.smallest_change(Arrays.asList(1, 2, 3, 4, 3, 2, 2))); // Output: 1
        System.out.println(solution.smallest_change(Arrays.asList(1, 2, 3, 2, 1))); // Output: 0
    }
}

