    length is a prime number or false otherwise
    Examples
    prime_length("Hello") == true
    prime_length("abcdcba") == true
    prime_length("kittens") == true
    prime_length("orange") == false
     */
    public boolean prime_length(String string) {
        // Step 1: Calculate the length of the string
        int length = string.length();

        // Step 2: Check if the length is less than 2 (not a prime number)
        if (length < 2) {
            return false;
        }

        // Step 3: Check if the length is divisible by any number from 2 to the square root of the length
        for (int i = 2; i <= Math.sqrt(length); i++) {
            if (length % i == 0) {
                return false;
            }
        }

        // Step 4: If no divisors were found, the length is a prime number
        return true;
    }
}

