class Solution {
    public boolean is_multiply_prime(int a) {
        // Step 1: Generate a list of prime numbers less than 100
        List<Integer> primes = generatePrimesLessThan100();

        // Step 2: Check if the given number can be expressed as the product of exactly 3 primes
        for (int i = 0; i < primes.size(); i++) {
            for (int j = i; j < primes.size(); j++) {
                for (int k = j; k < primes.size(); k++) {
                    if (primes.get(i) * primes.get(j) * primes.get(k) == a) {
                        return true;
                    }
                }
            }
        }

        return false;
    }

    // Helper method to generate a list of prime numbers less than 100
    private List<Integer> generatePrimesLessThan100() {
        List<Integer> primes = new ArrayList<>();
        boolean[] isPrime = new boolean[100];
        Arrays.fill(isPrime, true);
        isPrime[0] = false; // 0 is not a prime number
        isPrime[1] = false; // 1 is not a prime number

        for (int i = 2; i < 100; i++) {
            if (isPrime[i]) {
                primes.add(i);
                for (int j = i * i; j < 100; j += i) {
                    isPrime[j] = false;
                }
            }
        }

        return primes;
    }
}

