class Solution {
    public boolean iscube(int a) {
        // Special case for 0
        if (a == 0) {
            return true;
        }

        // Compute the cube root of the absolute value of a
        double cubeRoot = Math.cbrt(Math.abs(a));

        // Round the cube root to the nearest integer
        int roundedCubeRoot = (int) Math.round(cubeRoot);

        // Check if the cube of the rounded integer equals a
        return Math.pow(roundedCubeRoot, 3) == a;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.iscube(1));    // true
        System.out.println(solution.iscube(2));    // false
