class Solution {
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 1; // Only one 1-digit number starts or ends with 1
        }

        long power10_n_minus_1 = (long) Math.pow(10, n - 1);
        long power10_n_minus_2 = (long) Math.pow(10, n - 2);

        long countStartsWith1 = power10_n_minus_1;
        long countEndsWith1 = 9 * power10_n_minus_2;
        long countBothStartAndEndWith1 = power10_n_minus_2;

        long result = countStartsWith1 + countEndsWith1 - countBothStartAndEndWith1;

        return (int) result;
    }

