class Solution {
    public String solve(int N) {
        int sum_of_digits = 0;

        // Step 1: Compute the sum of digits
        while (N > 0) {
            int digit = N % 10;
            sum_of_digits += digit;
            N /= 10;
        }

        // Step 2: Convert the sum to binary
        String binary_sum = convertToBinary(sum_of_digits);

        return binary_sum;
    }

    private String convertToBinary(int number) {
        StringBuilder binaryString = new StringBuilder();

        // Step 3: Convert the number to binary
        while (number > 0) {
            binaryString.insert(0, number % 2);
            number /= 2;
        }

        return binaryString.toString();
    }
}

