        for (int i = 0; i < lst.size(); i++) {
            // Check if the index is odd and the element is even
            if (i % 2 != 0 && lst.get(i) % 2 == 0) {
                // Add the element to the sum
                sum += lst.get(i);
            }
        }

        // Return the final sum
        return sum;
    }
}

