class Solution {
    /**
    Create a function encrypt that takes a string as an argument and
    returns a string encrypted with the alphabet being rotated.
    The alphabet should be rotated in a manner such that the letters
    shift down by two multiplied to two places (i.e., 4 places).
    For example:
    encrypt("hi") returns "lm"
    encrypt("asdfghjkl") returns "ewhjklnop"
    encrypt("gf") returns "kj"
    encrypt("et") returns "ix"
     */
    public String encrypt(String s) {
        // Define the shift amount
        int shift = 4;
        // Initialize a StringBuilder to build the encrypted string
        StringBuilder encrypted = new StringBuilder();

        // Iterate over each character in the input string
        for (char c : s.toCharArray()) {
            // Check if the character is a lowercase letter
            if (c >= 'a' && c <= 'z') {
                // Calculate the new character after shifting
                char shiftedChar = (char) ((c - 'a' + shift) % 26 + 'a');
                encrypted.append(shiftedChar);
            } else {
                // If not a lowercase letter, append the character as is
                encrypted.append(c);
            }
        }

        // Return the encrypted string
        return encrypted.toString();
    }

    // Test the function
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.encrypt("hi")); // Output: lm
        System.out.println(solution.encrypt("asdfghjkl")); // Output: ewhjklnop
        System.out.println(solution.encrypt("gf")); // Output: kj
        System.out.println(solution.encrypt("et")); // Output: ix
    }
}

