class Solution {
    /**
    You'll be given a string of words, and your task is to count the number
    of boredoms. A boredom is a sentence that starts with the word "I".
    Sentences are delimited by '.', '?' or '!'.

    For example:
    >>> is_bored("Hello world")
    0
    >>> is_bored("The sky is blue. The sun is shining. I love this weather")
    1
     */
    public int is_bored(String S) {
        // Step 1: Split the input string into sentences using delimiters '.', '?', '!'
        String[] sentences = S.split("[.?!]");

        // Step 2: Initialize a counter to keep track of the number of boredoms
        int boredomCount = 0;

        // Step 3: Iterate through each sentence
        for (String sentence : sentences) {
            // Step 4: Trim leading and trailing whitespace from the sentence
            String trimmedSentence = sentence.trim();

            // Step 5: Check if the sentence starts with "I"
            if (trimmedSentence.startsWith("I")) {
                // Step 6: Increment the boredom count
                boredomCount++;
            }
        }

        // Step 7: Return the final boredom count
        return boredomCount;
    }
}

