class Solution {
    /**
    Create a function that takes 3 numbers.
    Returns true if one of the numbers is equal to the sum of the other two, and all numbers are integers.
    Returns false in any other cases.

    Examples
    any_int(5, 2, 7) -> true

    any_int(3, 2, 2) -> false

    any_int(3, -2, 1) -> true

    any_int(3.6, -2.2, 2) -> false
     */
    public boolean any_int(Object x, Object y, Object z) {
        // Step 1: Convert the objects to doubles to handle both integer and floating-point inputs
        double num1 = ((Number) x).doubleValue();
        double num2 = ((Number) y).doubleValue();
        double num3 = ((Number) z).doubleValue();

        // Step 2: Check if all numbers are integers
        boolean allIntegers = (num1 == Math.floor(num1) && !Double.isInfinite(num1)) &&
                             (num2 == Math.floor(num2) && !Double.isInfinite(num2)) &&
                             (num3 == Math.floor(num3) && !Double.isInfinite(num3));

        // Step 3: Check if one of the numbers is equal to the sum of the other two
        boolean sumCondition = (num1 == num2 + num3) || (num2 == num1 + num3) || (num3 == num1 + num2);

        // Step 4: Return true if both conditions are met, otherwise return false
        return allIntegers && sumCondition;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.any_int(5, 2, 7)); // true
        System.out.println(solution.any_int(3, 2, 2)); // false
        System.out.println(solution.any_int(3, -2, 1)); // true
        System.out.println(solution.any_int(3.6, -2.2, 2)); // false
    }
}

