class Solution {
    public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
        List<List<Integer>> result = new ArrayList<>();

        // Iterate through each row
        for (int i = 0; i < lst.size(); i++) {
            List<Integer> row = lst.get(i);
            // Iterate through each column in reverse order to ensure descending order
            for (int j = row.size() - 1; j >= 0; j--) {
                if (row.get(j).equals(x)) {
                    // Add the coordinate (row, column) to the result
                    result.add(Arrays.asList(i, j));
                }
            }
        }

        // Sort the result by rows in ascending order
        result.sort((a, b) -> a.get(0).compareTo(b.get(0)));

        return result;
    }

