class Solution {
    public String encode(String message) {
        // Define a map for vowel replacements
        Map<Character, Character> vowelMap = new HashMap<>();
        vowelMap.put('a', 'c');
        vowelMap.put('e', 'g');
        vowelMap.put('i', 'k');
        vowelMap.put('o', 'q');
        vowelMap.put('u', 'w');
        vowelMap.put('A', 'C');
        vowelMap.put('E', 'G');
        vowelMap.put('I', 'K');
        vowelMap.put('O', 'Q');
        vowelMap.put('U', 'W');

        StringBuilder encodedMessage = new StringBuilder();

        // Iterate through each character in the message
        for (char c : message.toCharArray()) {
            // Check if the character is a vowel and replace it
            if (vowelMap.containsKey(c)) {
                encodedMessage.append(vowelMap.get(c));
            } else {
                // Swap the case of the character
                if (Character.isLowerCase(c)) {
                    encodedMessage.append(Character.toUpperCase(c));
                } else {
                    encodedMessage.append(Character.toLowerCase(c));
                }
            }
        }

        return encodedMessage.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.encode("test")); // Output: "TGST"
        System.out.println(solution.encode("This is a message")); // Output: "tHKS KS C MGSSCGG"
