class Solution {
    public Optional<Integer> next_smallest(List<Integer> lst) {
        // If the list has less than 2 elements, return Optional.empty
        if (lst.size() < 2) {
            return Optional.empty();
        }

        // Convert the list to a set to remove duplicates
        Set<Integer> set = new HashSet<>(lst);

        // If the set has less than 2 unique elements, return Optional.empty
        if (set.size() < 2) {
            return Optional.empty();
        }

        // Convert the set back to a list and sort it
        List<Integer> sortedList = new ArrayList<>(set);
        Collections.sort(sortedList);

        // Return the second smallest element
        return Optional.of(sortedList.get(1));
    }
}

