class Solution {
    /**
    Create a function that takes a value (string) representing a number
    and returns the closest integer to it. If the number is equidistant
    from two integers, round it away from zero.

    Examples
    >>> closest_integer("10")
    10
    >>> closest_integer("15.3")
    15

    Note:
    Rounding away from zero means that if the given number is equidistant
    from two integers, the one you should return is the one that is the
    farthest from zero. For example closest_integer("14.5") should
    return 15 and closest_integer("-14.5") should return -15.
     */
    public int closest_integer(String value) {
        // Convert the string to a double
        double num = Double.parseDouble(value);

        // Get the floor and ceiling values of the number
        int floorValue = (int) Math.floor(num);
        int ceilValue = (int) Math.ceil(num);

        // Check if the number is exactly halfway between two integers
        if (num - floorValue == 0.5) {
            // Round away from zero
            return num > 0 ? ceilValue : floorValue - 1;
        } else if (ceilValue - num == 0.5) {
            // Round away from zero
            return num > 0 ? ceilValue : floorValue - 1;
        } else {
            // Round to the nearest integer
            return (int) Math.round(num);
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.closest_integer("10"));    // Output: 10
        System.out.println(solution.closest_integer("15.3"));  // Output: 15
        System.out.println(solution.closest_integer("14.5"));  // Output: 15
        System.out.println(solution.closest_integer("-14.5")); // Output: -15
    }
}

