class Solution {
    public boolean check_dict_case(Map<Object, Object> dict) {
        // If the dictionary is empty, return false
        if (dict.isEmpty()) {
            return false;
        }

        // Initialize variables to track the case of the first key
        boolean isFirstKeyLowerCase = true;
        boolean isFirstKeyUpperCase = true;

        // Iterate through the keys of the dictionary
        for (Object key : dict.keySet()) {
            // Check if the key is not a string
            if (!(key instanceof String)) {
                return false;
            }

            String strKey = (String) key;

            // Check the case of the first key
            if (isFirstKeyLowerCase && !strKey.equals(strKey.toLowerCase())) {
                isFirstKeyLowerCase = false;
            }
            if (isFirstKeyUpperCase && !strKey.equals(strKey.toUpperCase())) {
                isFirstKeyUpperCase = false;
            }

            // If both cases are invalid, return false
            if (!isFirstKeyLowerCase && !isFirstKeyUpperCase) {
                return false;
            }
        }

        // If all keys are either all lowercase or all uppercase, return true
        return true;
    }
}

