class Solution {
    public List<Integer> sort_array(List<Integer> array) {
        // Create a copy of the original array to avoid modifying it
        List<Integer> sortedArray = new ArrayList<>(array);

        // Check if the array is empty or has only one element
        if (sortedArray.isEmpty() || sortedArray.size() == 1) {
            return sortedArray;
        }

        // Calculate the sum of the first and last elements
        int sum = sortedArray.get(0) + sortedArray.get(sortedArray.size() - 1);

        // Determine the sorting order based on the sum
        if (sum % 2 == 0) {
            // Sort in descending order
            sortedArray.sort(Collections.reverseOrder());
        } else {
            // Sort in ascending order
            sortedArray.sort(Comparator.naturalOrder());
        }

        return sortedArray;
    }
}

