class Solution {
    /**
    Given a positive integer n, you have to make a pile of n levels of stones.
    The first level has n stones.
    The number of stones in the next level is:
        - the next odd number if n is odd.
        - the next even number if n is even.
    Return the number of stones in each level in a list, where element at index
    i represents the number of stones in the level (i+1).

    Examples:
    >>> make_a_pile(3)
    [3, 5, 7]
     */
    public List<Integer> make_a_pile(int n) {
        // Initialize the list to store the number of stones in each level
        List<Integer> pile = new ArrayList<>();

        // The number of stones in the current level
        int currentStones = n;

        // Loop through each level from 1 to n
        for (int i = 0; i < n; i++) {
            // Add the current number of stones to the pile
            pile.add(currentStones);

            // Determine the next number of stones based on the current number
            if (currentStones % 2 == 0) {
                // If the current number of stones is even, add 2 to get the next even number
                currentStones += 2;
            } else {
                // If the current number of stones is odd, add 2 to get the next odd number
                currentStones += 2;
            }
        }

        // Return the list of stones in each level
        return pile;
    }

    // Main method to test the function
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.make_a_pile(3)); // Output: [3, 5, 7]
    }
}

