class Solution {
    public Object rounded_avg(int n, int m) {
        // Check if n is greater than m
        if (n > m) {
            return -1;
        }

        // Calculate the sum of integers from n to m
        int sum = 0;
        for (int i = n; i <= m; i++) {
            sum += i;
        }

        // Calculate the number of integers from n to m
        int count = m - n + 1;

        // Calculate the average and round it to the nearest integer
        int average = Math.round((float) sum / count);

        // Convert the rounded average to binary
        String binary = Integer.toBinaryString(average);

        return binary;
    }
}

