class Solution {
    public Map<String, Integer> histogram(String test) {
        // Step 1: Initialize an empty map to store the letter counts
        Map<String, Integer> letterCounts = new HashMap<>();

        // Step 2: Split the input string into an array of letters
        String[] letters = test.split(" ");

        // Step 3: Iterate through the array and update the count of each letter in the map
        for (String letter : letters) {
            if (!letter.isEmpty()) {
                letterCounts.put(letter, letterCounts.getOrDefault(letter, 0) + 1);
            }
        }

        // Step 4: Find the maximum count from the map
        int maxCount = 0;
        for (int count : letterCounts.values()) {
            if (count > maxCount) {
                maxCount = count;
            }
        }

        // Step 5: Create a new map to store the letters with the maximum count
        Map<String, Integer> result = new HashMap<>();

        // Step 6: Iterate through the original map and add letters with the maximum count to the new map
        for (Map.Entry<String, Integer> entry : letterCounts.entrySet()) {
            if (entry.getValue() == maxCount) {
                result.put(entry.getKey(), entry.getValue());
            }
        }

        // Step 7: Return the new map
        return result;
    }
}

