class Solution {
    public List<Integer> even_odd_palindrome(int n) {
        int evenCount = 0;
        int oddCount = 0;

        for (int i = 1; i <= n; i++) {
            if (isPalindrome(i)) {
                if (i % 2 == 0) {
                    evenCount++;
                } else {
                    oddCount++;
                }
            }
        }

        List<Integer> result = new ArrayList<>();
        result.add(evenCount);
        result.add(oddCount);

        return result;
    }

    private boolean isPalindrome(int number) {
        String numStr = Integer.toString(number);
        int left = 0;
        int right = numStr.length() - 1;

        while (left < right) {
            if (numStr.charAt(left) != numStr.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }

        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.even_odd_palindrome(3)); // Output: [1, 2]
        System.out.println(solution.even_odd_palindrome(12)); // Output: [4, 6]
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.even_odd_palindrome(123).equals(Arrays.asList(8, 13)),
                s.even_odd_palindrome(12).equals(Arrays.asList(4, 6)),
                s.even_odd_palindrome(3).equals(Arrays.asList(1, 2)),
                s.even_odd_palindrome(63).equals(Arrays.asList(6, 8)),
                s.even_odd_palindrome(25).equals(Arrays.asList(5, 6)),
                s.even_odd_palindrome(19).equals(Arrays.asList(4, 6)),
                s.even_odd_palindrome(9).equals(Arrays.asList(4, 5)),
                s.even_odd_palindrome(1).equals(Arrays.asList(0, 1))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

