class Solution {
    public List<Integer> unique_digits(List<Integer> x) {
        // Step 1: Create a list to store the result
        List<Integer> result = new ArrayList<>();

        // Step 2: Iterate through each number in the input list
        for (Integer num : x) {
            // Step 3: Check if the number contains any even digit
            if (!containsEvenDigit(num)) {
                // Step 4: If no even digit is found, add the number to the result list
                result.add(num);
            }
        }

        // Step 5: Sort the result list in increasing order
        Collections.sort(result);

        // Step 6: Return the result list
        return result;
    }

    // Helper method to check if a number contains any even digit
    private boolean containsEvenDigit(int num) {
        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) {
                return true;
            }
            num /= 10;
        }
        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.unique_digits(Arrays.asList(15, 33, 1422, 1)).equals(Arrays.asList(1, 15, 33)),
                s.unique_digits(Arrays.asList(152, 323, 1422, 10)).equals(List.of()),
                s.unique_digits(Arrays.asList(12345, 2033, 111, 151)).equals(Arrays.asList(111, 151)),
                s.unique_digits(Arrays.asList(135, 103, 31)).equals(Arrays.asList(31, 135))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

