class Solution {
    public List<String> by_length(List<Integer> arr) {
        // Define the mapping from digits to their names
        String[] digitNames = {"One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine"};

        // Filter out numbers that are not between 1 and 9
        List<Integer> filteredList = arr.stream()
                                        .filter(num -> num >= 1 && num <= 9)
                                        .sorted()
                                        .collect(Collectors.toList());

        // Reverse the filtered and sorted list
        Collections.reverse(filteredList);

        // Convert the numbers to their corresponding names
        List<String> result = new ArrayList<>();
        for (int num : filteredList) {
            result.add(digitNames[num - 1]);
        }

        return result;
    }
}

