class Solution {
    public List<Object> reverse_delete(String s, String c) {
        // Step 1: Create a set of characters from string c for quick lookup
        Set<Character> charsToRemove = new HashSet<>();
        for (char ch : c.toCharArray()) {
            charsToRemove.add(ch);
        }

        // Step 2: Build the result string by excluding characters present in the set
        StringBuilder result = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (!charsToRemove.contains(ch)) {
                result.append(ch);
            }
        }

        // Step 3: Check if the result string is a palindrome
        String resultStr = result.toString();
        String reversedStr = result.reverse().toString();
        boolean isPalindrome = resultStr.equals(reversedStr);

        // Step 4: Return the result string and the palindrome check result as a list
        List<Object> resultList = new ArrayList<>();
        resultList.add(resultStr);
        resultList.add(isPalindrome);

        return resultList;
    }
}

