class Solution {
    public boolean moveOneBall(List<Integer> arr) {
        // If the array is empty, return true
        if (arr.isEmpty()) {
            return true;
        }

        // Create a copy of the original list and sort it
        List<Integer> sortedArr = new ArrayList<>(arr);
        Collections.sort(sortedArr);

        // Check if the original array is already sorted
        if (arr.equals(sortedArr)) {
            return true;
        }

        // Try to find the number of right shifts needed to make the array sorted
        for (int i = 0; i < arr.size(); i++) {
            // Perform a right shift
            Integer lastElement = arr.remove(arr.size() - 1);
            arr.add(0, lastElement);

            // Check if the array is now sorted
            if (arr.equals(sortedArr)) {
                return true;
            }
        }

        // If no number of right shifts can make the array sorted, return false
        return false;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.moveOneBall(Arrays.asList(3, 4, 5, 1, 2))); // true
        System.out.println(solution.moveOneBall(Arrays.asList(3, 5, 4, 1, 2))); // false
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.move_one_ball(new ArrayList<>(Arrays.asList(3, 4, 5, 1, 2))) == true,
                s.move_one_ball(new ArrayList<>(Arrays.asList(3, 5, 10, 1, 2))) == true,
                s.move_one_ball(new ArrayList<>(Arrays.asList(4, 3, 1, 2))) == false,
                s.move_one_ball(new ArrayList<>(Arrays.asList(3, 5, 4, 1, 2))) == false,
                s.move_one_ball(new ArrayList<>(Arrays.asList())) == true
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

