class Solution {
    /**
    Given an array of integers nums, find the minimum sum of any non-empty sub-array
    of nums.
    Example
    minSubArraySum(Arrays.asList(2, 3, 4, 1, 2, 4)) == 1
    minSubArraySum(Arrays.asList(-1, -2, -3)) == -6
     */
    public int minSubArraySum(List<Integer> nums) {
        // Initialize variables to store the current minimum sum and the overall minimum sum
        int currentMinSum = nums.get(0);
        int overallMinSum = nums.get(0);

        // Iterate through the list starting from the second element
        for (int i = 1; i < nums.size(); i++) {
            // Update the current minimum sum by either adding the current element to the previous sum
            // or starting a new sub-array with the current element
            currentMinSum = Math.min(nums.get(i), currentMinSum + nums.get(i));

            // Update the overall minimum sum if the current minimum sum is smaller
            overallMinSum = Math.min(overallMinSum, currentMinSum);
        }

        // Return the overall minimum sum
        return overallMinSum;
    }
}

