class Solution {
    public int max_fill(List<List<Integer>> grid, int capacity) {
        // Initialize the total number of bucket uses
        int totalBucketUses = 0;

        // Iterate over each column in the grid
        for (int col = 0; col < grid.get(0).size(); col++) {
            int waterUnits = 0;

            // Count the total water units in the current column
            for (int row = 0; row < grid.size(); row++) {
                waterUnits += grid.get(row).get(col);
            }

            // Calculate the number of bucket uses needed for this column
            int bucketUsesForColumn = (int) Math.ceil((double) waterUnits / capacity);

            // Add the bucket uses for this column to the total
            totalBucketUses += bucketUsesForColumn;
        }

        return totalBucketUses;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Example 1
        List<List<Integer>> grid1 = Arrays.asList(
            Arrays.asList(0, 0, 1, 0),
            Arrays.asList(0, 1, 0, 0),
            Arrays.asList(1, 1, 1, 1)
        );
        int capacity1 = 1;
        System.out.println(solution.max_fill(grid1, capacity1)); // Output: 6

        // Example 2
        List<List<Integer>> grid2 = Arrays.asList(
            Arrays.asList(0, 0, 1, 1),
            Arrays.asList(0, 0, 0, 0),
            Arrays.asList(1, 1, 1, 1),
            Arrays.asList(0, 1, 1, 1)
        );
        int capacity2 = 2;
        System.out.println(solution.max_fill(grid2, capacity2)); // Output: 5

        // Example 3
        List<List<Integer>> grid3 = Arrays.asList(
            Arrays.asList(0, 0, 0),
            Arrays.asList(0, 0, 0)
        );
        int capacity3 = 5;
        System.out.println(solution.max_fill(grid3, capacity3)); // Output: 0
    }
}

