class Solution {
    public List<Integer> sort_array(List<Integer> arr) {
        // Sort the array using a custom comparator
        arr.sort((a, b) -> {
            // Count the number of ones in the binary representation of both numbers
            int countA = Integer.bitCount(a);
            int countB = Integer.bitCount(b);

            // If the number of ones is the same, sort by the decimal value
            if (countA == countB) {
                return a - b;
            }

            // Otherwise, sort by the number of ones
            return countA - countB;
        });

        return arr;
    }
}

