class Solution {
    public List<String> select_words(String s, int n) {
        // Step 1: Check if the string is empty
        if (s.isEmpty()) {
            return new ArrayList<>();
        }

        // Step 2: Split the string into words
        String[] words = s.split("\\s+");

        // Step 3: Initialize a list to store the result
        List<String> result = new ArrayList<>();

        // Step 4: Iterate through each word
        for (String word : words) {
            // Step 5: Count the number of consonants in the word
            int consonantCount = countConsonants(word);

            // Step 6: If the number of consonants matches n, add the word to the result list
            if (consonantCount == n) {
                result.add(word);
            }
        }

        // Step 7: Return the result list
        return result;
    }

    // Helper method to count the number of consonants in a word
    private int countConsonants(String word) {
        int count = 0;
        for (char c : word.toCharArray()) {
            if (isConsonant(c)) {
                count++;
            }
        }
        return count;
    }

    // Helper method to check if a character is a consonant
    private boolean isConsonant(char c) {
        return !isVowel(c) && Character.isLetter(c);
    }

    // Helper method to check if a character is a vowel
    private boolean isVowel(char c) {
        return "AEIOUaeiou".indexOf(c) != -1;
    }
}

