class Solution {
    /**
    You are given a list of two strings, both strings consist of open
    parentheses "(" or close parentheses ")" only.
    Your job is to check if it is possible to concatenate the two strings in
    some order, that the resulting string will be good.
    A string S is considered to be good if and only if all parentheses in S
    are balanced. For example: the string "(())()" is good, while the string
    "())" is not.
    Return "Yes" if there's a way to make a good string, and return "No" otherwise.

    Examples:
    match_parens(Arrays.asList("()(", ")")) == "Yes"
    match_parens(Arrays.asList(")", ")")) == "No"
     */
    public String match_parens(List<String> lst) {
        // Step 1: Check if concatenating in the first order results in a balanced string
        String firstConcat = lst.get(0) + lst.get(1);
        if (isBalanced(firstConcat)) {
            return "Yes";
        }

        // Step 2: Check if concatenating in the second order results in a balanced string
        String secondConcat = lst.get(1) + lst.get(0);
        if (isBalanced(secondConcat)) {
            return "Yes";
        }

        // Step 3: If neither order results in a balanced string, return "No"
        return "No";
    }

    // Helper method to check if a string of parentheses is balanced
    private boolean isBalanced(String s) {
        int balance = 0;
        for (char c : s.toCharArray()) {
            if (c == '(') {
                balance++;
            } else if (c == ')') {
                balance--;
                if (balance < 0) {
                    return false; // Early exit if balance goes negative
                }
            }
        }
        return balance == 0; // Final check to ensure all parentheses are balanced
    }
}

