class Solution {
    public List<Integer> get_odd_collatz(int n) {
        // Step 1: Generate the Collatz sequence starting from n
        List<Integer> collatzSequence = new ArrayList<>();
        while (n != 1) {
            collatzSequence.add(n);
            if (n % 2 == 0) {
                n /= 2;
            } else {
                n = 3 * n + 1;
            }
        }
        collatzSequence.add(1); // Add 1 to the sequence as it is always the last element

        // Step 2: Filter out the odd numbers from the Collatz sequence
        List<Integer> oddNumbers = new ArrayList<>();
        for (int num : collatzSequence) {
            if (num % 2 != 0) {
                oddNumbers.add(num);
            }
        }

        // Step 3: Sort the list of odd numbers in increasing order
        Collections.sort(oddNumbers);

        // Step 4: Return the sorted list of odd numbers
        return oddNumbers;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.get_odd_collatz(5)); // Output: [1, 5]
        System.out.println(solution.get_odd_collatz(6)); // Output: [1, 3]
        System.out.println(solution.get_odd_collatz(7)); // Output: [1, 7, 11, 23]
    }
}

