class Solution {
    public Object split_words(String txt) {
        // Check if the string contains whitespace
        if (txt.contains(" ")) {
            // Split the string on whitespace and return the list
            return Arrays.asList(txt.split(" "));
        }
        // Check if the string contains commas
        else if (txt.contains(",")) {
            // Split the string on commas and return the list
            return Arrays.asList(txt.split(","));
        } else {
            // Count the number of lowercase letters with odd order in the alphabet
            int count = 0;
            for (char c : txt.toCharArray()) {
                if (Character.isLowerCase(c) && ((c - 'a') % 2 == 1)) {
                    count++;
                }
            }
            return count;
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.split_words("Hello world!")); // ["Hello", "world!"]
        System.out.println(solution.split_words("Hello,world!")); // ["Hello", "world!"]
        System.out.println(solution.split_words("abcdef")); // 3
    }
}

