class Solution {
    public boolean valid_date(String date) {
        // Check if the date string is empty
        if (date == null || date.isEmpty()) {
            return false;
        }

        // Check if the date is in the correct format mm-dd-yyyy
        String[] parts = date.split("-");
        if (parts.length != 3) {
            return false;
        }

        // Parse the date parts
        try {
            int month = Integer.parseInt(parts[0]);
            int day = Integer.parseInt(parts[1]);
            int year = Integer.parseInt(parts[2]);

            // Check if the month is valid
            if (month < 1 || month > 12) {
                return false;
            }

            // Check if the day is valid based on the month
            if (day < 1 || day > 31) {
                return false;
            }

            // Check specific day limits for each month
            if (month == 2 && day > 29) {
                return false;
            } else if ((month == 4 || month == 6 || month == 9 || month == 11) && day > 30) {
                return false;
            }

            // If all checks pass, the date is valid
            return true;
        } catch (NumberFormatException e) {
            // If parsing fails, the date is invalid
            return false;
        }
    }

