class Solution {
    public boolean is_sorted(List<Integer> lst) {
        if (lst.size() <= 1) {
            return true;
        }

        int previous = lst.get(0);
        int count = 1;

        for (int i = 1; i < lst.size(); i++) {
            int current = lst.get(i);

            if (current < previous) {
                return false; // Not sorted
            }

            if (current == previous) {
                count++;
                if (count > 2) {
                    return false; // Element appears more than twice
                }
            } else {
                count = 1; // Reset count for a new element
            }

            previous = current;
        }

        return true;
    }
}

