class Solution {
    public String intersection(List<Integer> interval1, List<Integer> interval2) {
        // Step 1: Determine the intersection of the two intervals
        int start = Math.max(interval1.get(0), interval2.get(0));
        int end = Math.min(interval1.get(1), interval2.get(1));

        // Step 2: Check if there is no intersection
        if (start > end) {
            return "NO";
        }

        // Step 3: Calculate the length of the intersection
        int length = end - start + 1;

        // Step 4: Check if the length is a prime number
        if (isPrime(length)) {
            return "YES";
        } else {
            return "NO";
        }
    }

    // Helper method to check if a number is prime
    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n == 2) {
            return true;
        }
        if (n % 2 == 0) {
            return false;
        }
        for (int i = 3; i * i <= n; i += 2) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }
}

