class Solution {
    public Optional<Integer> prod_signs(List<Integer> arr) {
        // If the array is empty, return Optional.empty()
        if (arr.isEmpty()) {
            return Optional.empty();
        }

        // Initialize variables to store the sum of magnitudes and the product of signs
        int sumOfMagnitudes = 0;
        int productOfSigns = 1;

        // Iterate through the array to calculate the sum of magnitudes and the product of signs
        for (int num : arr) {
            if (num == 0) {
                productOfSigns = 0;
                break; // If any number is zero, the product of signs will be zero
            }
            sumOfMagnitudes += Math.abs(num);
            productOfSigns *= (num > 0) ? 1 : -1;
        }

        // Return the result as an Optional
        return Optional.of(sumOfMagnitudes * productOfSigns);
    }
}

