class Solution {
    /**
    Given a positive integer n, return the product of the odd digits.
    Return 0 if all digits are even.
    For example:
    digits(1)  == 1
    digits(4)  == 0
    digits(235) == 15
     */
    public int digits(int n) {
        // Step 1: Initialize the product variable to 1.
        int product = 1;
        // Step 2: Initialize a boolean flag to check if there are any odd digits.
        boolean hasOddDigit = false;

        // Step 3: Loop through each digit of the number.
        while (n > 0) {
            // Step 4: Extract the last digit.
            int digit = n % 10;
            // Step 5: Check if the digit is odd.
            if (digit % 2 != 0) {
                // Step 6: Multiply the product by the odd digit.
                product *= digit;
                // Step 7: Set the flag to true since we found an odd digit.
                hasOddDigit = true;
            }
            // Step 8: Remove the last digit from the number.
            n /= 10;
        }

        // Step 9: If no odd digits were found, return 0.
        if (!hasOddDigit) {
            return 0;
        }

        // Step 10: Return the product of the odd digits.
        return product;
    }
}

