class Solution {
    public List<Integer> tri(int n) {
        List<Integer> result = new ArrayList<>();
        if (n == 0) {
            result.add(1);
            return result;
        }

        // Initialize the base cases
        result.add(1); // tri(0) = 1
        result.add(3); // tri(1) = 3

        // Compute the Tribonacci sequence up to n
        for (int i = 2; i <= n; i++) {
            if (i % 2 == 0) {
                result.add(1 + i / 2);
            } else {
                result.add(triRecursive(result, i));
            }
        }

        return result;
    }

    private int triRecursive(List<Integer> result, int n) {
        if (n == 0) return 1;
        if (n == 1) return 3;

        if (n % 2 == 0) {
            return 1 + n / 2;
        } else {
            return result.get(n - 1) + result.get(n - 2) + triRecursive(result, n + 1);
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.tri(3)); // Output: [1, 3, 2, 8]
    }
}

