class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int N = grid.size();
        PriorityQueue<Path> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < Math.min(a.path.size(), b.path.size()); i++) {
                if (!a.path.get(i).equals(b.path.get(i))) {
                    return a.path.get(i) - b.path.get(i);
                }
            }
            return a.path.size() - b.path.size();
        });

        // Directions: up, down, left, right
        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

        // Add all starting positions to the priority queue
        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                pq.offer(new Path(grid.get(i).get(j), new ArrayList<>(List.of(grid.get(i).get(j))), new int[]{i, j}));
            }
        }

        while (!pq.isEmpty()) {
            Path current = pq.poll();
            if (current.path.size() == k) {
                return current.path;
            }
            int[] pos = current.position;
            for (int[] dir : directions) {
                int newX = pos[0] + dir[0];
                int newY = pos[1] + dir[1];
                if (newX >= 0 && newX < N && newY >= 0 && newY < N) {
                    List<Integer> newPath = new ArrayList<>(current.path);
                    newPath.add(grid.get(newX).get(newY));
                    pq.offer(new Path(grid.get(newX).get(newY), newPath, new int[]{newX, newY}));
                }
            }
        }

        return new ArrayList<>(); // Should never reach here
    }

    static class Path {
        int currentValue;
        List<Integer> path;
        int[] position;

        Path(int currentValue, List<Integer> path, int[] position) {
            this.currentValue = currentValue;
            this.path = path;
            this.position = position;
        }
    }
}

