class Solution {
    public boolean is_nested(String string) {
        Stack<Character> stack = new Stack<>();
        boolean nested = false;

        for (char c : string.toCharArray()) {
            if (c == '[') {
                stack.push(c);
            } else if (c == ']') {
                if (stack.isEmpty()) {
                    // Unmatched closing bracket
                    return false;
                }
                stack.pop();
                if (!stack.isEmpty()) {
                    // If the stack is not empty after popping, it means we have a nested structure
                    nested = true;
                }
            }
        }

        // Check if there are any unmatched opening brackets left
        if (!stack.isEmpty()) {
            return false;
        }

        return nested;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.is_nested("[[]]")); // true
        System.out.println(solution.is_nested("[]]]]]]][[[[[]")); // false
        System.out.println(solution.is_nested("[][]")); // false
        System.out.println(solution.is_nested("[]")); // false
        System.out.println(solution.is_nested("[[][]]")); // true
        System.out.println(solution.is_nested("[[]][[")); // true
    }
}

