class Solution {
    /**
    Evaluate whether the given number n can be written as the sum of exactly 4 positive even numbers
    Example
    is_equal_to_sum_even(4) == false
    is_equal_to_sum_even(6) == false
    is_equal_to_sum_even(8) == true
     */
    public boolean is_equal_to_sum_even(int n) {
        // Step 1: Understand the problem
        // We need to check if the given number n can be expressed as the sum of exactly 4 positive even numbers.
        // Positive even numbers are 2, 4, 6, 8, etc.

        // Step 2: Analyze the conditions
        // The smallest sum of 4 positive even numbers is 2 + 2 + 2 + 2 = 8.
        // Any number less than 8 cannot be expressed as the sum of 4 positive even numbers.
        // For any number greater than or equal to 8, we can always express it as 8 + (n-8), where (n-8) is a multiple of 2.

        // Step 3: Create the algorithm
        // 1. If n is less than 8, return false.
        // 2. If n is greater than or equal to 8 and (n - 8) is even, return true.
        // 3. Otherwise, return false.

        // Step 4: Implement the algorithm in Java

        if (n < 8) {
            return false;
        }

        // Check if (n - 8) is even
        return (n - 8) % 2 == 0;
    }
}

