class Solution {
    public int sum_squares(List<Integer> lst) {
        // Initialize the sum to 0
        int sum = 0;

        // Iterate through the list
        for (int i = 0; i < lst.size(); i++) {
            int num = lst.get(i);

            // Check if the index is a multiple of 3
            if (i % 3 == 0) {
                sum += num * num; // Square the number and add to sum
            } 
            // Check if the index is a multiple of 4 but not a multiple of 3
            else if (i % 4 == 0 && i % 3 != 0) {
                sum += num * num * num; // Cube the number and add to sum
            } 
            // If the index is neither a multiple of 3 nor 4, add the number as is
            else {
                sum += num;
            }
        }

        // Return the final sum
        return sum;
    }

