class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        // Helper function to calculate the sum of digits of an integer
        class DigitSumComparator implements Comparator<Integer> {
            @Override
            public int compare(Integer num1, Integer num2) {
                int sum1 = sumOfDigits(num1);
                int sum2 = sumOfDigits(num2);
                if (sum1 != sum2) {
                    return sum1 - sum2;
                } else {
                    return nums.indexOf(num1) - nums.indexOf(num2);
                }
            }

            private int sumOfDigits(int num) {
                boolean isNegative = num < 0;
                int sum = 0;
                while (num != 0) {
                    int digit = num % 10;
                    if (isNegative && num < 0) {
                        digit = -digit;
                    }
                    sum += digit;
                    num /= 10;
                }
                return sum;
            }
        }

        // Sort the list using the custom comparator
        Collections.sort(nums, new DigitSumComparator());

        return nums;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Integer> nums1 = Arrays.asList(1, 11, -1, -11, -12);
        System.out.println(solution.order_by_points(nums1)); // Output: [-1, -11, 1, -12, 11]

        List<Integer> nums2 = Arrays.asList();
        System.out.println(solution.order_by_points(nums2)); // Output: []
    }
}

