class Solution {
    public int specialFilter(List<Integer> nums) {
        // Initialize a counter to keep track of the numbers that meet the criteria
        int count = 0;

        // Iterate through each number in the list
        for (int num : nums) {
            // Check if the number is greater than 10
            if (num > 10) {
                // Convert the number to a string to easily access the first and last digits
                String numStr = String.valueOf(Math.abs(num));
                char firstDigit = numStr.charAt(0);
                char lastDigit = numStr.charAt(numStr.length() - 1);

                // Check if both the first and last digits are odd
                if (isOdd(firstDigit) && isOdd(lastDigit)) {
                    // Increment the counter if the number meets all criteria
                    count++;
                }
            }
        }

        // Return the final count
        return count;
    }

    // Helper method to check if a character represents an odd digit
    private boolean isOdd(char digit) {
        return digit == '1' || digit == '3' || digit == '5' || digit == '7' || digit == '9';
    }
}

