class Solution {
    public int get_max_triples(int n) {
        // Step 1: Generate the array a based on the given formula
        int[] a = new int[n];
        for (int i = 1; i <= n; i++) {
            a[i - 1] = i * i - i + 1;
        }

        // Step 2: Count the number of valid triples (a[i], a[j], a[k]) where i < j < k
        int count = 0;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                for (int k = j + 1; k < n; k++) {
                    if ((a[i] + a[j] + a[k]) % 3 == 0) {
                        count++;
                    }
                }
            }
        }

        // Step 3: Return the count of valid triples
        return count;
    }

    public static void main(String[] args) {
