class Solution {
    public List<String> sorted_list_sum(List<String> lst) {
        // Step 1: Remove strings with odd lengths
        List<String> filteredList = new ArrayList<>();
        for (String s : lst) {
            if (s.length() % 2 == 0) {
                filteredList.add(s);
            }
        }

        // Step 2: Sort the list by length and then alphabetically
        Collections.sort(filteredList, new Comparator<String>() {
            @Override
            public int compare(String s1, String s2) {
                if (s1.length() != s2.length()) {
                    return s1.length() - s2.length();
                } else {
                    return s1.compareTo(s2);
                }
            }
        });

        return filteredList;
    }

