    public List<String> bf(String planet1, String planet2) {
        // Define the list of planets in order of proximity to the Sun
        List<String> planets = Arrays.asList("Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune");

        // Check if both planet names are valid
        if (!planets.contains(planet1) || !planets.contains(planet2)) {
            return new ArrayList<>();
        }

        // Find the indices of the input planets
        int index1 = planets.indexOf(planet1);
        int index2 = planets.indexOf(planet2);

        // Ensure index1 is less than index2
        if (index1 > index2) {
            int temp = index1;
            index1 = index2;
            index2 = temp;
        }

        // Extract the sublist of planets between the two indices
        List<String> result = planets.subList(index1 + 1, index2);

        // Return the result
        return result;
    }
}

