class Solution {
    /**
    Given a list of numbers, return the sum of squares of the numbers
    in the list that are odd. Ignore numbers that are negative or not integers.

    double_the_difference(Arrays.asList(1, 3, 2, 0)) == 1 + 9 + 0 + 0 = 10
    double_the_difference(Arrays.asList(-1, -2, 0)) == 0
    double_the_difference(Arrays.asList(9, -2)) == 81
    double_the_difference(Arrays.asList(0)) == 0

    If the input list is empty, return 0.
     */
    public int double_the_difference(List<Object> lst) {
        int sumOfSquares = 0;

        for (Object obj : lst) {
            if (obj instanceof Integer) {
                int num = (Integer) obj;
                if (num > 0 && num % 2 != 0) {
                    sumOfSquares += num * num;
                }
            }
        }

        return sumOfSquares;
    }
}

