class Solution {
    /**
    Write a function that accepts a list of strings.
    The list contains different words. Return the word with the maximum number
    of unique characters. If multiple strings have the maximum number of unique
    characters, return the one which comes first in lexicographical order.

    find_max(["name", "of", "string"]) == "string"
    find_max(["name", "enam", "game"]) == "enam"
    find_max(["aaaaaaa", "bb" ,"cc"]) == "aaaaaaa"
     */
    public String find_max(List<String> words) {
        // Initialize variables to keep track of the word with the maximum unique characters
        String maxWord = "";
        int maxUniqueChars = 0;

        // Iterate through each word in the list
        for (String word : words) {
            // Use a HashSet to count the unique characters in the current word
            Set<Character> uniqueChars = new HashSet<>();
            for (char c : word.toCharArray()) {
                uniqueChars.add(c);
            }

            // Check if the current word has more unique characters than the previous max
            if (uniqueChars.size() > maxUniqueChars || (uniqueChars.size() == maxUniqueChars && word.compareTo(maxWord) < 0)) {
                maxWord = word;
                maxUniqueChars = uniqueChars.size();
            }
        }

        return maxWord;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.find_max(new ArrayList<>(Arrays.asList("name", "of", "string"))).equals("string"),
                s.find_max(new ArrayList<>(Arrays.asList("name", "enam", "game"))).equals("enam"),
                s.find_max(new ArrayList<>(Arrays.asList("aaaaaaa", "bb", "cc"))).equals("aaaaaaa"),
                s.find_max(new ArrayList<>(Arrays.asList("abc", "cba"))).equals("abc"),
                s.find_max(new ArrayList<>(Arrays.asList("play", "this", "game", "of", "footbott"))).equals("footbott"),
                s.find_max(new ArrayList<>(Arrays.asList("we", "are", "gonna", "rock"))).equals("gonna"),
                s.find_max(new ArrayList<>(Arrays.asList("we", "are", "a", "mad", "nation"))).equals("nation"),
                s.find_max(new ArrayList<>(Arrays.asList("this", "is", "a", "prrk"))).equals("this"),
                s.find_max(new ArrayList<>(List.of("b"))).equals("b"),
                s.find_max(new ArrayList<>(Arrays.asList("play", "play", "play"))).equals("play")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

