class Solution {
    public List<Integer> generate_integers(int a, int b) {
        // Ensure a is always less than or equal to b
        if (a > b) {
            int temp = a;
            a = b;
            b = temp;
        }

        // List to store the even digits
        List<Integer> evenDigits = new ArrayList<>();

        // Iterate through the range from a to b
        for (int i = a; i <= b; i++) {
            // Check if the current number is a single digit and even
            if (i >= 0 && i < 10 && i % 2 == 0) {
                evenDigits.add(i);
            }
        }

        // Return the list of even digits
        return evenDigits;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.generate_integers(2, 8)); // [2, 4, 6, 8]
        System.out.println(solution.generate_integers(8, 2)); // [2, 4, 6, 8]
        System.out.println(solution.generate_integers(10, 14)); // []
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.generate_integers(2, 10).equals(Arrays.asList(2, 4, 6, 8)),
                s.generate_integers(10, 2).equals(Arrays.asList(2, 4, 6, 8)),
                s.generate_integers(132, 2).equals(Arrays.asList(2, 4, 6, 8)),
                s.generate_integers(17, 89).equals(List.of())
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}
